const pyCodeCompleter = {
  getCompletions: function(editor, session, pos, prefix, callback) {
    const completions = [];
    pythonCode.forEach((code) => {
      completions.push({
        caption: code.name,
        value: code.value,
        score: code.score,
        meta: code.meta,
        children: code.children || ''
      });
    });
    callback(null, completions);
  }
};

export default pyCodeCompleter;